      REAL(KIND(1d0))::MT,MW,MH,MZ,EL
      COMPLEX(KIND(1d0))::res
      EL=Decay_e
      MT=Decay_MT
      MW=Decay_MW
      MH=Decay_MH
      MZ=Decay_MZ
      res=   (0.03125*EL**2*
     -    (-2*MW**6 - 
     -      (MC**4 + MS**4 + 
     -         MS**2*MW**2 - 
     -         2*MW**4 + 
     -         MC**2*
     -          (-2*MS**2 + MW**2))
     -        *Csqrt2(MC**4 + 
     -         (MS**2 - MW**2)**
     -          2 - 
     -         2*MC**2*
     -          (MS**2 + MW**2))))/
     -  (MW**5*
     -    (Pi - (MW**2*Pi)/MZ**2))
      Width_W2cs_qmass=DBLE(res)
      END

